Housewife 1 on 1 - Candy Manson

Actors: Candy Manson, Christian

Release Date: November 10, 2010

Who: Bad Girl, Wife,

Where: Couch, Living room,

Candy is looking for her motorcycle helmet because she is late for her new tattoo appointment. Her bookish husband is dismayed about it, but Candy explains that he knew she was a bad girl ever since they met. Her crazy life doesn't change the fact that she loves him and wants to make him happy all the time. As a matter of fact, Candy is going to skip her appointment and spend the next hour pleases her husband instead.
